import logo from './logo.svg';
import './App.css';

function App() {
  const title = "Titel";
  const like = 50;
  return (
    <div className="App">
      <div className="content">
        <h1>{title}</h1>
        <p>Liked {like}</p>
      </div>
    </div>
  );
}

export default App;
